uot;clearfix text-formatted field field--name-body field--type-text-with-summary field--label-hidden field__item&quot;&gt;&lt;p&gt;L’arc de triomphe de l’Étoile, souvent appelé simplement l’Arc de triomphe, dont la construction, décidée par l&#039;empereur Napoléon Iᵉʳ, débuta en 1806 et s&#039;acheva en 1836 sous Louis-Philippe, est situé à Paris, dans les 8ᵉ, 16ᵉ, et 17ᵉ arrondissements&lt;/p&gt;&lt;/div&gt;\n      \n  &lt;/div&gt;\n&lt;/article&gt;\n</description>\n  <pubDate>Wed, 06 Nov 2019 10:36:46 +0000</pubDate>\n    <dc:creator>Vého</dc:creator>\n    <guid isPermaLink=\"false\">6 at http://localhost/eval-d8/web</guid>\n    </item>\n<item>\n  <title>Cathédrale Notre Dame de Paris</title>\n  <link>http://localhost/eval-d8/web/monument/paris/cathedrale-notre-dame-de-paris</link>\n  <description>\n&lt;article data-history-node-id=&quot;5&quot; data-quickedit-entity-id=&quot;node/5&quot; role=&quot;article&quot; class=&quot;contextual-region node node--type-monument node--view-mode-teaser clearfix&quot; about=&quot;/eval-d8/web/monument/paris/cathedrale-notre-dame-de-paris&quot;&gt;\n  &lt;header&gt;\n    \n            &lt;h2 class=&quot;node__title&quot;&gt;\n        &lt;a href=&quot;/eval-d8/web/monument/paris/cathedrale-notre-dame-de-paris&quot; rel=&quot;bookmark&quot;&gt;&lt;span data-quickedit-field-id=&quot;node/5/title/en/teaser&quot; class=&quot;field field--name-title field--type-string field--label-hidden&quot;&gt;Cathédrale Notre Dame de Paris&lt;/span&gt;\n&lt;/a&gt;\n      &lt;/h2&gt;\n        &lt;div data-contextual-id=&quot;node:node=5:changed=1573206344&amp;amp;langcode=en&quot; data-contextual-token=&quot;IdmPHJiamzlKw_Szf7pTgpVt-d2FxxeLdTe7-b0fIZk&quot;&gt;&lt;/div&gt;\n          &lt;div class=&quot;node__meta&quot;&gt;\n        &lt;article data-quickedit-entity-id=&quot;user/1&quot; class=&quot;contextual-region profile&quot; typeof=&quot;schema:Person&quot; about=&quot;/eval-d8/web/user/1&quot;&gt;\n  &lt;/article&gt;\n\n        &lt;span&gt;