;a href=&quot;/eval-d8/web/taxonomy/term/10&quot; hreflang=&quot;en&quot;&gt;Religieux&lt;/a&gt;&lt;/div&gt;\n          &lt;/div&gt;\n  \n            &lt;div data-quickedit-field-id=&quot;node/5/field_ville/en/teaser&quot; class=&quot;field field--name-field-ville field--type-entity-reference field--label-hidden field__item&quot;&gt;&lt;a href=&quot;/eval-d8/web/ville/paris&quot; hreflang=&quot;en&quot;&gt;Paris&lt;/a&gt;&lt;/div&gt;\n      \n            &lt;div data-quickedit-field-id=&quot;node/5/body/en/teaser&quot; class=&quot;clearfix text-formatted field field--name-body field--type-text-with-summary field--label-hidden field__item&quot;&gt;&lt;p&gt;La &lt;strong&gt;cathédrale Notre-Dame de Paris&lt;/strong&gt;, communément appelée &lt;strong&gt;Notre-Dame&lt;/strong&gt;, est la &lt;a href=&quot;https://fr.wikipedia.org/wiki/Cath%C3%A9drale&quot;&gt;c&lt;/a&gt;athédrale de l&#039;archidiocèse de Paris, située sur l&#039;île de la Cité. Dédiée à la Vierge Marie, elle est pendant de nombreux siècles l&#039;une des cathédrales les plus grandes d&#039;Occident. Longtemps la plus haute construction de la ville, elle est l&#039;un des monuments les plus emblématiques de Paris.&lt;/p&gt;&lt;/div&gt;\n      \n  &lt;/div&gt;\n&lt;/article&gt;\n</description>\n  <pubDate>Wed, 06 Nov 2019 10:31:43 +0000</pubDate>\n    <dc:creator>Vého</dc:creator>\n    <guid isPermaLink=\"false\">5 at http://localhost/eval-d8/web</guid>\n    </item>\n<item>\n  <title>Tour Eiffel</title>\n  <link>http://localhost/eval-d8/web/monument/paris/tour-eiffel</link>\n  <description>\n&lt;article data-history-node-id=&quot;4&quot; data-quickedit-entity-id=&quot;node/4&quot; role=&quot;article&quot; class=&quot;contextual-region node node--type-monument node--view-mode-teaser clearfix&quot; about=&quot;/eval-d8/web/monument/paris/tour-eiffel&quot;&gt;\n  &lt;header&gt;\n    \n            &lt;h2 class=&quot;node__title&quot;&gt;\n        &lt;a href=&quot;/eval-d8/web/monument/paris/tour-eiffel&quot;